package ru.cheranev;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.RequestBody;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;
import org.springframework.web.bind.annotation.RestController;

import java.io.IOException;

/**
 * @author Cheranev N.
 *         created on 27.02.2017.
 */
@RestController
@RequestMapping("/sendmail")
public class EmailController {

    @Autowired
    private EmailService emailService;

    /*
     {
     "from":"nickcheranev@gmail.com",
     "to":"nickcheranev@gmail.com",
     "cc":"nickcheranev@gmail.com",
     "bcc":"nickcheranev@mail.ru",
     "subject":"subject",
     "text":"Hello",
     "attachments":[{"filename":"hello.png","content":""}]
     }
    */

    @RequestMapping(method = RequestMethod.POST)
    public String send(@RequestBody EmailDto emailDto) throws IOException {

        emailService.sendEmail(emailDto);
        return "email sended";
    }
}
